import React, { useEffect, useState } from 'react';
import './Home.css'; // Your consolidated CSS file
import ImageCarousel from './ImageCarousel'; // Import the carousel component

// --- Mock Images for the Carousel ---
// Replace these with your actual image paths or URLs
import imageUrl1 from './images/gallery-1.jpg';
import imageUrl2 from './images/gallery-2.jpg';
import imageUrl3 from './images/gallery-3.jpg';
import imageUrl4 from './images/gallery-4.jpg';
import imageUrl5 from './images/gallery-5.jpg';
import imageUrl6 from './images/gallery-6.jpg';
import imageUrl7 from './images/gallery-7.jpg';
import imageUrl8 from './images/gallery-8.jpg';


const Home = () => {
  const [scrollY, setScrollY] = useState(0);

  // Array of images to pass to the carousel component
  const galleryImages = [
    imageUrl1,
    imageUrl2,
    imageUrl3,
    imageUrl4,
    imageUrl5,
    imageUrl6,
    imageUrl7,
    imageUrl8,
  ];

  useEffect(() => {
    const handleScroll = () => {
      setScrollY(window.scrollY);
    };

    const handleResize = () => {
      // Logic to handle resize events if necessary
    };

    window.addEventListener('scroll', handleScroll);
    window.addEventListener('resize', handleResize);

    // Intersection Observer for fade-in animations
    const sections = document.querySelectorAll('.services-section');
    const observer = new IntersectionObserver((entries) => {
      entries.forEach(entry => {
        if (entry.isIntersecting) {
          entry.target.classList.add('in-view');
        }
      });
    }, { threshold: 0.2 });

    sections.forEach(section => observer.observe(section));

    return () => {
      window.removeEventListener('scroll', handleScroll);
      window.removeEventListener('resize', handleResize);
      sections.forEach(section => observer.unobserve(section));
    };
  }, []);

  const parallaxStyle = {
    transform: `translate3d(0, ${scrollY * 0.4}px, 0)`
  };

  return (
    <div className="home-page-clone">

      {/* --- HERO SECTION --- */}
      <section className="hero-section">
        <div className="parallax-background" style={{ ...parallaxStyle, backgroundImage: `url(${imageUrl1})` }}></div>
        <div className="hero-pattern-overlay"></div>
        <div className="hero-content">
          <div className="hero-text-content">
            <h1 className="hero-main-title">Timeless</h1>
            <h2 className="hero-subtitle">Events</h2>
            <h3 className="hero-accent">Crafted with Passion</h3>
          </div>
        </div>
        <a href="#services" className="hero-scroll-indicator" aria-label="Scroll down">
          <div className="scroll-dot"></div>
        </a>
      </section>

      {/* --- SERVICES SECTION --- */}
      <section id="services" className="services-section">
        <div className="services-text-column">
          <div className="services-content">
            <h2>Our Services</h2>
            <div className="services-icon">
                {/* You can place an SVG or image here */}
                <svg className="floral-ornament" viewBox="0 0 120 40" xmlns="http://www.w3.org/2000/svg"><path d="..." fill="#8b7355"/></svg>
            </div>
            <p>From intimate gatherings to grand celebrations, we specialize in creating unforgettable experiences tailored to your unique vision.</p>
            <a href="/services" className="discover-button">Discover More</a>
          </div>
        </div>
        <div className="services-image-column" style={{ backgroundImage: `url(${imageUrl2})` }}></div>
      </section>

      {/* --- GALLERY CAROUSEL SECTION --- */}
      <section className="gallery-carousel-section">
        <div className="gallery-carousel-header">
          <h2>Gallery of Success</h2>
          <p>Explore a curated collection of our most memorable events, each telling a unique story of collaboration and celebration.</p>
        </div>

        {/* The ImageCarousel component is placed here */}
        <ImageCarousel images={galleryImages} />

        <div className="gallery-carousel-cta">
          <a href="/gallery" className="discover-button-dark">View Full Gallery</a>
        </div>
      </section>

      {/* --- TESTIMONIALS SECTION (Example) --- */}
      <section className="testimonials-section">
        {/* You can add a testimonials component or content here */}
        <h2>What Our Clients Say</h2>
      </section>

    </div>
  );
};

export default Home;
